import React, {useEffect, useState}  from 'react';
import Card from './Card/index';

const Education = () => {
    const [message, setMessage] = useState('');
    useEffect(() => { // eventually will have to change this to permanent server host endpoint
    fetch('http://localhost:3306/education')
      .then((res) => res.text())
      .then((data) => {
        console.log(data);
        setMessage(data);
      })
      .catch((err) => console.log(err));
  }, []);

    const courses = ['FS100', 'FS101', 'MATH200', 'CPSC110', 'CPSC427'];

    return (
        <div 
            style={{
                fontFamily: 'serif'
            }}
        >
            <Circle courses={courses}/>
        </div>
    );
    // TODO:
    // create dynamic containers
    // parse db response 
};

export default Education;
